import React from 'react';
import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import Body from './components/Body';

const title = store.getState();



export default function App({ title }) {
  return (
    <div className="App">
      <Header title={title} />
      <Body />
      <Footer />
    </div>
  )
}
